-- ----------------------------
-- View structure for active_shifts
-- ----------------------------
DROP VIEW IF EXISTS `active_shifts`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `active_shifts` AS select `uk`.`id` AS `unit_kerja_id`,`uk`.`nama` AS `unit_nama`,`uk`.`uses_shift_system` AS `uses_shift_system`,`uk`.`shift_enabled` AS `shift_enabled`,`uk`.`shift_pagi_path` AS `shift_pagi_path`,`uk`.`shift_malam_path` AS `shift_malam_path`,(case when ((`uk`.`uses_shift_system` = TRUE) and (`uk`.`shift_enabled` = TRUE)) then (case when ((cast(now() as time) >= '08:00:00') and (cast(now() as time) < '16:30:00')) then 'pagi' else 'malam' end) else NULL end) AS `current_shift`,(case when ((`uk`.`uses_shift_system` = TRUE) and (`uk`.`shift_enabled` = TRUE)) then (case when ((cast(now() as time) >= '08:00:00') and (cast(now() as time) < '16:30:00')) then `uk`.`shift_pagi_path` else `uk`.`shift_malam_path` end) else NULL end) AS `current_shift_path` from `unit_kerja` `uk` where ((`uk`.`uses_shift_system` = TRUE) and (`uk`.`shift_enabled` = TRUE));

